import React, { Component } from 'react';
import { useParams } from "react-router-dom";
import { Paper, Grid, Button, CssBaseline, Container,  Typography } from '@material-ui/core';
import axios from 'axios'
import Map from '../components/Map'
import FormContact from "../components/FormContact";

export default class Propiedad extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { name } = this.props
        return (
            <div>
                <Grid container spacing={3}>
                    <h1>{name}</h1>
                    <Grid item xs={6}>
                        <Use
                            list={prop}
                            />
                    </Grid> 
                </Grid>   
            </div>
        )
    }
}

function Use(props) {
    let { id } = useParams();
    const zoomP = 13
    const heightP = 300

    return (
        <div>
            <>
                {props.list.map(item => {
                    if (id == item.id) {
                        return (
                            <div key={item.id}>
                                <Propiedad
                                   name= {item.tittle}
                                />
                                <Map
                                    lat={item.lat}
                                    long={item.long}
                                    zoom={zoomP}
                                    popup={item.tittle}
                                    height={heightP}                          
                                />                     
                            </div>
                        )
                    }
                })}
            </>
            <FormContact />
        </div>

    );
}
